  let counter = 0

  function increment(){
    counter +=1
    console.log(counter)
  }

  return (
    <div>
    <Header title='Be The Hero'> {counter} </Header> 
    <button onClick={increment}>Incrementar</button>
    </div>
  );
}

export default App;
